/* ***********************************************************************/ /*!
  @fn               static uint8 RTE_COMOnRx_GetActualFRTime(void);

  @brief            Get the actual FR time stamp with respect to the delay of
                    this function call.

  @description      With the call to FrIf_GetGlobalTime(), the time NOW is returned;
                    The call delay to this function call (Com_Signal\SignalGroup_Notification)
                    is one FR cyle. Hence one FR cycle is subtract.

  @return           FR cycle counter, on which the signal\signalgroup was transmitted on the FR;

  @pre              Use only within Com_Signal\SignalGroup_Notification; 
                    A different call context may have a different offset;

  @post             none

  @author           Andreas Gilch (Fa. b-plus GmbH)

**************************************************************************** */
static uint8 RTE_COMOnRx_GetActualFRTime(void)
{
  static  uint8  ui8_FrIf_Cycle = 0u;
  static uint16 ui16_FrIf_MacroTick = 0u;

  /* Get FR CycleCounter: */
  if( E_OK != FrIf_GetGlobalTime(FRIF_VCTRL_IDX, &ui8_FrIf_Cycle, &ui16_FrIf_MacroTick) )
  {
    ui8_FrIf_Cycle = 0xFFu;
    ui16_FrIf_MacroTick = 0xFFFFu;
  }
  /* As this function call is always one FR cycle after the actual cycle the signal was received on,
   * the cycle counter is corrected: minus one; */

  /* Consider the case, that the recent Cycle = 0 and than the actual cycle was 63.
  * -> 0x0 -0x1 = 0xFF; 0xFF & 0x3F = 63;n*/
  ui8_FrIf_Cycle = ( (ui8_FrIf_Cycle -1) & 0x3F);

  return (ui8_FrIf_Cycle);

}


